class AppState {
    constructor() {
        this.state = {
            loggedUserneame : ""
        };
    }

    getLoggedUser() {
        console.log("am ajuns aici")
        return this.state.loggedUserneame;
    }

    setLoggedUserId(username) {
        this.state.loggedUserneame = username
    }
}
const AppInstance = new AppState();
export default AppInstance;
